<script>
function wdquery() {
dd = wddata.value.replace(/[\[\]\{\}\+\*\#\$\€\√\π\÷\×\=\^\°\¢\¥\£\~\`\|\•\§\∆\<\>]/g, "").split("\n");
dd = [...new Set(dd)];
dd = dd.sort();
if (lang.value == "nl") {
dd = dd.filter(a => String(a).includes("(NL)"));
} else if (lang.value == "en") {
dd = dd.filter(a => !String(a).includes("(NL)"));
}
odd = dd.length;
dd = dd.filter(a => String(a).includes(String(qury.value)));
if (Number(lngth.value) > 0) {
dd = dd.filter(a => String(a).length == Number(lngth.value));
}
results.value = dd.join(",  ");
res.innerText = dd.length + " / " + odd + " result(s) found";
}
